import React from 'react';
import { Col, Row, Card, Typography, Button } from 'antd';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import FooterComponent from '../components/footer';
import bannerProximamente from '../img/proximamente.png';
import Akira from '../img/Akira.jpg';
import MagoOz from '../img/elMagodeOz.png';
import LoQueElVientoSeLlevo from '../img/loQelVientoseLlevo.jpg';

const { Title } = Typography;

function Cartelera() {
  return (
    <div>
      <Row>
        <Col xs={24}>
          <Navbar />
        </Col>
      </Row>

      <Row>
        <Col xs={24}>
          <div>
            <img src={bannerProximamente} alt="Banner" style={{ width: '100%' }} />
          </div>
        </Col>
      </Row>

      <Row justify="center" style={{ marginTop: 20, gap: 20 }}>
        <Col xs={24} md={20} lg={16}>
          <Title
            level={1}
            style={{
              color: 'black',
              textAlign: 'center',
              margin: '3% 0 4%',
              fontSize: '4rem',
              fontWeight: 300,
              maxWidth: '100%',
            }}
          >
            ¡No te pierdas las próximas películas que se transmitirán en nuestro cine!
          </Title>

          {[ 
            { 
              imgSrc: Akira, 
              imgAlt: "Akira", 
              linkTo: "/CarteleraAkira", 
              title: "Akira (1988)", 
              description: "La trama sigue a Kaneda, el líder de una banda de motociclistas, y a su amigo Tetsuo, quien adquiere poderes psíquicos después de un accidente con un misterioso niño de apariencia envejecida. A medida que Tetsuo lucha por controlar sus nuevas habilidades, su poder crece de manera descontrolada, poniendo en peligro a la ciudad y a sus habitantes. Kaneda intenta salvar a su amigo y detener su destructiva evolución, mientras una serie de secretos gubernamentales y experimentos relacionados con un proyecto conocido como 'Akira' salen a la luz."
            },
            { 
              imgSrc: MagoOz, 
              imgAlt: "MagoOz", 
              linkTo: "/CarteleraMagoOz", 
              title: "El mago de Oz (1939)", 
              description: "En su viaje por este mundo maravilloso, Dorothy conoce a nuevos amigos: el Espantapájaros, que desea tener un cerebro; el Hombre de Hojalata, que anhela un corazón; y el León Cobarde, que busca valor. Juntos, emprenden un camino hacia la Ciudad Esmeralda para encontrar al Mago de Oz, quien supuestamente tiene el poder de concederles sus deseos. En el camino, enfrentan varios desafíos y peligros, principalmente provocados por la Malvada Bruja del Oeste, quien busca vengarse de Dorothy por la muerte de su hermana, la Malvada Bruja del Este."
            },
            { 
              imgSrc: LoQueElVientoSeLlevo, 
              imgAlt: "LoQueElVientoSeLlevo", 
              linkTo: "/CarteleraLoQueElVientoSeLevo", 
              title: "Lo que el viento se llevó (1939)", 
              description: "La trama sigue la vida de Scarlett O'Hara, la obstinada y decidida hija de un acaudalado terrateniente de Georgia. La película comienza con Scarlett viviendo en la plantación de su familia, Tara, y narra su lucha por sobrevivir a la guerra y la caída del Sur. En el centro de la historia está el turbulento romance entre Scarlett y Rhett Butler, un aventurero sin escrúpulos pero encantador."
            }
          ].map((movie, index) => (
            <Card key={index} style={{ width: '100%', borderRadius: 8, padding: '1%', marginBottom: '2.5%' }}>
              <Row gutter={[16, 16]}>
                <Col xs={24} md={8}>
                  <Link to={movie.linkTo}>
                    <img
                      src={movie.imgSrc}
                      alt={movie.imgAlt}
                      style={{ width: '80%', marginTop: '-5%', marginBottom: '-5%', borderRadius: 8 }}
                    />
                  </Link>
                </Col>
                <Col xs={24} md={16}>
                  <Link to={movie.linkTo}>
                    <Title level={1} style={{ marginTop: '1%', color: 'red', fontWeight: 300 }}>
                      {movie.title}
                    </Title>
                  </Link>
                  <p style={{ marginTop: '1%', fontSize: 16, lineHeight: 1.5 }}>
                    {movie.description}
                  </p>
                </Col>
              </Row>
            </Card>
          ))}

          <Row justify="left">
            <Col xs={24} md={20} lg={16}>
              <Link to="/">
                <Button
                  type="default"
                  style={{
                    width: '8%',
                    height: '120%',
                    backgroundColor: '#454a46',
                    borderColor: '#d9d9d9',
                    color: 'white',
                  }}
                >
                  Volver
                </Button>
              </Link>
            </Col>
          </Row>
        </Col>
      </Row>

      <FooterComponent />
    </div>
  );
}

export default Cartelera;
